import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="main">
      <a href="/home">
        <img className="logo" src="./images/Twenteefore - Logo 2.png" />
      </a>
      <nav className="navbar">
        <li className="li">
          {" "}
          {/* <Link className="homeLink" href="/">
            Home
          </Link> */}
        </li>
        <li className="li">
          <a className="orderLink" href="/">
            Order
          </a>
        </li>
        <li className="li">
          <a className="leaderboardsLink" href="/">
            Leaderboards
          </a>
        </li>
        <li className="li">
          {" "}
          <a className="marketplaceLink" href="/">
            Marketplace
          </a>
        </li>
        <li className="li">
          {" "}
          <a className="faqsLink" href="/faqs">
            FAQs
          </a>
        </li>
      </nav>
      <a className="loginLink" href="/login">
        <button id="loginLink">Log In</button>
      </a>
    </div>
  );
};
export default NavBar;
